import Header from '../components/header'
import Litter from '../../components/index-sections/litter'
import Footer from '../../components/footer'

const Litters = () => {
    return (
        <div>
            <Header/>
            <Litter />
            <Footer/>
        </div>
    )
}

export default Litters
